const TagLine = () => {
    const tag = [{
        tagline: '2M+ Happy Customers',
        img: ''
    },
    {
        tagline: 'Proudly Made in India',
        img: ''
    },
    {
        tagline: '3M+ Plastic bottles recycled',
        img: ''
    },
    {
        tagline: 'Eco friendly fashion',
        img: ''
    }
    ]

    return (
        <div className="tagBar">


            {tag.map(tg => (
                <div className="tags">
                    <img src={tg.img}></img>
                    <p>{tg.tagline}</p>
                </div>
            ))
            }

        </div>
    );
}

export default TagLine;
